import React, { useState } from 'react';
import { Row, Col } from 'react-bootstrap';
import { motion, AnimatePresence } from 'framer-motion';
import { Menu, Search, User, ShoppingCart, ChevronDown } from 'lucide-react';
import '../styles/landingpage/header.scss';

export default function Header({ viewport }) {
  const [showCatalog, setShowCatalog] = useState(false);
  const [showMenu, setShowMenu] = useState(false);

  const toggleCatalog = () => setShowCatalog(prev => !prev);
  const toggleMenu = () => setShowMenu(prev => !prev);

  // ðŸ”¹ MOBILE HEADER
  if (viewport === 'xs') {
    return (
      <Row id="header">
        <Col xs={10} id="header-businessnamecontainer">
          <motion.h3
            className="header-title"
            initial={{ opacity: 0, y: -20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 1 }}
          >
            Trustee
          </motion.h3>
        </Col>

        <Col xs={2} id="header-menuiconcontainer">
          <Menu size={28} color="#007bff" onClick={toggleMenu} style={{ cursor: 'pointer' }} />
        </Col>

        <AnimatePresence>
          {showMenu && (
            <motion.div
              id="header-hamburgerdropdowncontainer"
              initial={{ x: '100%' }}
              animate={{ x: 0 }}
              exit={{ x: '100%' }}
              transition={{ type: 'spring', stiffness: 100, damping: 15 }}
            >
              <p>Catalog</p>
              <p>Sellers</p>
              <p>Help Center</p>
              <p>Sign in / Sign up</p>
              <p>Sell Now</p>
            </motion.div>
          )}
        </AnimatePresence>
      </Row>
    );
  }

  // ðŸ”¹ DESKTOP HEADER
  return (
    <Row id="header">
      {/* Business name */}
      <Col md={2} id="header-businessnamecontainer">
        <motion.h3
          className="header-title"
          initial={{ opacity: 0 }}
          animate={{ opacity: 1 }}
          transition={{ duration: 1.2 }}
        >
          Trustee
        </motion.h3>
      </Col>

      {/* Search bar with catalog dropdown */}
      <Col md={7} id="header-productsearchbarcontainer">
        <div id="header-search-wrapper">
          <div className="dropdown-container">
            <div className="dropdown-header" onClick={toggleCatalog}>
              <span>Catalog</span>
              <ChevronDown size={18} color="#007bff" />
            </div>

            <AnimatePresence>
              {showCatalog && (
                <motion.div
                  className="dropdown-menu"
                  initial={{ opacity: 0, y: -10 }}
                  animate={{ opacity: 1, y: 0 }}
                  exit={{ opacity: 0, y: -10 }}
                  transition={{ duration: 0.2 }}
                >
                  <p>Catalog</p>
                  <p>Sellers</p>
                  <p>Help Center</p>
                </motion.div>
              )}
            </AnimatePresence>
          </div>

          <div className="search-container">
            <input type="text" placeholder="Search products..." />
            <Search className="search-icon" size={20} />
          </div>
        </div>
      </Col>

      {/* Sign In / Cart */}
      <Col md={3} id="header-actionscontainer">
        <div className="actions">
          <User className="action-icon" size={22} />
          <ShoppingCart className="action-icon" size={22} />
          <button className="sell-now-btn">Sell Now</button>
        </div>
      </Col>
    </Row>
  );
}
